
import {View,StatusBar,Image,Text,FlatList,
	ActivityIndicator,Pressable,TouchableOpacity,Modal,
	TextInput,StyleSheet} from 'react-native'
import NavbarPublicSpace from '../components/NavbarPublicSpace';
import {SafeAreaView} from 'react-native-safe-area-context'
import {useState,useEffect} from 'react';
// import SpaceCard from '../components/SpaceCard';
import {createSpace,getSpaceWithCode,getAllPublicSpace,getUserById} from '../utils/ApiRoutes';
import {useRecoilState} from 'recoil'
import {currentUserState,currentSpaceState,currentSongInfoState} from '../atoms/userAtom';
import {useRouter} from 'next/navigation';
import Icon from 'react-native-vector-icons/Ionicons';
import Icon3 from 'react-native-vector-icons/FontAwesome6';
import Icon2 from 'react-native-vector-icons/MaterialCommunityIcons';
import axios from 'axios';
import LinearGradient from 'react-native-linear-gradient';

const particleImage2 = {uri:'data:image/png;base64,'}
const particleImage3 = {uri:'data:image/png;base64,'}
const musicImage = {uri:'data:image/png;base64,'}

export default function HomeScreen({navigation}) {
	const [spaceList,setSpaceList] = useState([]);
	const [openCreateWindow,setOpenCreateWindow] = useState(false);
	const [enterCodeWindow,setEnterCodeWindow] = useState(false);
	const [spaceName,setSpaceName] = useState('');
	const [isPrivate,setIsPrivate] = useState(false);
	const [currentUser,setCurrentUser] = useRecoilState(currentUserState);
	const [currentSpace,setCurrentSpace] = useRecoilState(currentSpaceState)
	const [loading,setLoading] = useState(false);
	const [spaceCode,setSpaceCode] = useState('');
	const [showInfoBox,setShowInfoBox] = useState('');
	const [joinWithCodeOpen,setJoinWithCodeOpen] = useState(false);
	const [currentSongInfo,setCurrentSongInfo] = useRecoilState(currentSongInfoState);
	const [newSpaceCreateOpen,setNewSpaceCreateOpen] = useState(false);
	const [creatingPublicSpace,setCreatingPublicSpace] = useState(false);
	const [code,setCode] = useState('');

	function generateRandomId(length) {
	  const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
	  let randomId = '';

	  for (let i = 0; i < length; i++) {
	    const randomIndex = Math.floor(Math.random() * characters.length);
	    randomId += characters.charAt(randomIndex);
	  }

	  return randomId;
	}

	useEffect(()=>{
		if(!currentUser){
			// navigation.navigate('Login')
		}
		fetchSpaces()
	},[])


	const fetchSpaces = async() => {
		const {data} = await axios.get(getAllPublicSpace);
		setSpaceList([...data.space,...data.space,...data.space,...data.space,]);
		console.log(data.space)
	}

	const createSpaceFunc = async() => {
		setLoading(true);

		const code = await generateRandomId(5);
		const users = [currentUser];
		const {data} = await axios.post(createSpace,{
			ownerImage:currentUser.image,
			owner:currentUser.name,
			spaceName:spaceName,
			code,
			users
		})
		if(data.status){
			setCurrentSpace(data?.space);
			// router.push(`/space/${data?.space?.code}`);
		}
	}

	const joinSpaceWithCode = async(e) => {
		e.preventDefault();
		if(spaceCode.length > 3){
			setLoading(true);
			const {data} = await axios.get(`${getSpaceWithCode}/${spaceCode}`);
			if(data.status){
				setCurrentSpace(data?.space)
				setLoading(false)
				// router.push(`/space/${data?.space?.code}`)
			}else{
				setLoading(false);
				setShowInfoBox("Space not found");
				setTimeout(()=>{
					setShowInfoBox('');
				},4000)
			}	
		}
	}

	const goToSpace = async(code) => {
		if(code){
			const spaceCode = code;
			const {data} = await axios.get(`${getSpaceWithCode}/${spaceCode}`);
			if(data.status){
				setCurrentSpace(data?.space)
				setLoading(false)
				// router.push(`/space/${data?.space?.code}`)
			}else{
				setLoading(false);
				setShowInfoBox("Space not found");
				setTimeout(()=>{
					setShowInfoBox('');
				},4000)
			}				
		}
	}

	const getUpdatedCurrentUser = async() => {
		const {data} = await axios.post(getUserById,{id:currentUser?._id})
		if(data.status){
			setCurrentUser(data?.user);
			if(data?.user?.inSpace){
				goToSpace(data?.user?.inSpace);
			}
		}
	}

	useEffect(()=>{
		if(currentUser){
			getUpdatedCurrentUser()
		}
	},[currentUser])

	return (
	<View className="relative flex-1">
        <Modal
        animationType="fade"
        transparent={true}
        visible={showInfoBox}
        onRequestClose={() => {
          setShowInfoBox(false);
        }}>
	        <Pressable onPress={() => {
	          setShowInfoBox(false);
	        }} style={styles.centeredView}>
	          <View className="bg-gray-900/80 p-5 py-3 rounded-lg border-[1px] 
	          border-gray-200/50 border-solid" >
	            <Text style={{fontFamily:'Poppins-Medium'}} className="text-white text-lg">
	            	Cant join the space
	            </Text>
	          </View>
	        </Pressable>
      	</Modal>

		<Modal
        animationType="slide"
        transparent={true}
        visible={joinWithCodeOpen}
        onRequestClose={() => {
          setJoinWithCodeOpen(!joinWithCodeOpen);
        }}>
        	<View className="bg-black/70 h-full w-full flex items-center justify-center">
        		<LinearGradient 
				colors={['#000060', '#000020', '#410752']}
		        start={{ x: 0.5, y: 0 }}
		        end={{ x: 0.5, y: 1 }}
		        className="px-4 w-[85%] py-4 pb-3 flex items-center justify-center rounded-lg border-[1px] border-gray-600 relative" 
		        >
		        	<Text className="text-xl font-semibold text-white">
		        		Enter the Code
		        	</Text>
		        	<View className="w-full h-[2px] bg-gray-600/60 my-3"/>
		        	<TextInput value={code} onChangeText={(e)=>setCode(e)} placeholder="Enter Code"
					className="text-white w-[90%] border-[1px] border-gray-500 w-full px-3 text-center text-[17px] rounded-lg h-[50px]" />
					<TouchableOpacity onPress={()=>{
						if(code?.length > 0){
							setShowInfoBox(true);
							setJoinWithCodeOpen(false);
						}
					}} >
						<View className="px-4 pt-3">
							<Text className="text-white text-lg" >Join</Text>
						</View>
					</TouchableOpacity>

		        </LinearGradient>
        	</View>
        </Modal>

        <Modal
        animationType="slide"
        transparent={true}
        visible={newSpaceCreateOpen}
        onRequestClose={() => {
          setNewSpaceCreateOpen(!newSpaceCreateOpen);
        }}>
        	<View className="bg-black/70 h-full w-full flex items-center justify-center">
        		<LinearGradient 
				colors={['#000060', '#000020', '#410752']}
		        start={{ x: 0.5, y: 0 }}
		        end={{ x: 0.5, y: 1 }}
		        className="px-4 w-[85%] py-4 pb-3 flex items-center justify-center rounded-lg border-[1px] 
		        border-gray-500 relative" 
		        >
		        	<Text className="text-xl font-semibold text-white">
		        		Create New Space
		        	</Text>
		        	<View className="w-full h-[2px] bg-gray-600/60 my-3"/>
		        	<TextInput placeholder="Enter space name" value={spaceName} onChangeText={(e)=>setSpaceName(e)}
					className="text-white w-[90%] border-[1px] border-gray-500 w-full px-3 text-[17px] rounded-lg h-[50px]" />
					<TouchableOpacity onPress={()=>{
						setCreatingPublicSpace(!creatingPublicSpace);
					}} className="w-full ml-2" >
						<View className="flex flex-row items-center w-full gap-1 py-5 pb-3">
							{
								creatingPublicSpace ?
								<Icon name="lock-open-outline" size={22} color="white" />
								:
								<Icon name="lock-closed" size={22} color="white" />
							}
							<Text className="text-[18px] font-semibold text-white">
								{
									creatingPublicSpace ?
									'Public':'Private'
								} Space
							</Text>
						</View>
					</TouchableOpacity>
					
					<View className="flex pt-3 items-center justify-between flex-row w-full">
						<TouchableOpacity onPress={()=>{
							setSpaceName('');
							setNewSpaceCreateOpen(false);
						}}
						className="w-[48%]">
							<View className="w-full px-4 rounded-lg py-2 border-[1px] border-gray-600">
								<Text className="text-red-500 text-center text-[15px] font-semibold" >Cancel</Text>
							</View>
						</TouchableOpacity>
						<TouchableOpacity className="w-[48%]">
							<LinearGradient colors={['#aa55f4', '#cc4ec4', '#e9489d']}
					        useAngle={true} angle={90} 
					        className="w-full px-4 rounded-lg py-2 border-[1px] border-gray-800">
								<Text className="text-white font-bold text-center text-[15px] font-semibold" >
									Create
								</Text>
							</LinearGradient>
						</TouchableOpacity>
					</View>

		        </LinearGradient>


        	</View>

        </Modal>
        <NavbarPublicSpace navigation={navigation} LinearGradient={LinearGradient} 
        setNewSpaceCreateOpen={setNewSpaceCreateOpen} currentSongInfo={currentSongInfo}
        setJoinWithCodeOpen={setJoinWithCodeOpen} />
		<LinearGradient 
		colors={['#000060', '#000020', '#410752']}
        style={{
		    flex: 1,
		  }}
        start={{ x: 0.5, y: 0 }}
        end={{ x: 0.5, y: 1 }}
        className="flex-1 z-10 flex w-full px-4 py-4 relative" 
        >
        	<Image source={{uri:particleImage3.uri,height:5,width:5}}
			className="absolute top-[250px] right-0 z-0 h-[100px] w-[100px]"/>
			<Image source={{uri:particleImage3.uri,height:5,width:5}}
			className="absolute top-[550px] left-0 rotate-[180deg] z-0 h-[100px] w-[100px]"/>
			<Image source={{uri:particleImage2.uri,height:5,width:5}}
			className="absolute top-[300px] left-[10%] z-0 h-[100px] w-[100px]"/>
			<Image source={{uri:particleImage2.uri,height:5,width:5}}
			className="absolute top-[500px] right-[10%] z-0 h-[100px] w-[100px]"/>

			<StatusBar style="light-content"
			backgroundColor="rgba(0,0,0,0.1)"
			translucent={true}
			/>

			<SafeAreaView className="flex-1" >
				<View className="flex flex-row items-center">
					<TouchableOpacity onPress={()=>{
						navigation.navigate("Home")
					}} >
						<Icon2 name="arrow-left" size={28} color="white"/>
					</TouchableOpacity>
					<Text className="text-white ml-2 text-2xl font-semibold" >Join Public Space</Text>
				</View>
				<View className="h-[1px] rounded-full w-[100%] mt-5 bg-gray-100/40"/>
				<View className="flex" >
					<FlatList data={spaceList}
					horizontal={false}
					showsVerticalScrollIndicator={false}
					numColumns={2}
					columnWrapperStyle={{justifyContent: 'space-between',gap:10}}
					keyExtracter={item=>item._id}
					ListFooterComponent={()=>(
						<View className={`p-7 ${currentSongInfo ? 'mb-[120px]' : 'mb-14'}`} >

						</View>
					)}
					renderItem={({item,index})=>(
						<View className="w-[48%] mt-5 bg-gray-800/40 px-3 py-3 rounded-lg 
						border-[1px] border-solid border-gray-200/50 flex  items-center" >
							<View style={{
								elevation: 40,
    							shadowColor: 'red',
							}} >
								<Image source={{
									uri:item?.ownerImage || musicImage.uri,
									width:5
								}} style={{
									borderWidth:0.5,
									borderColor:'gray',

								}} 
								className="aspect-square w-full rounded-lg border-[1px] border-solid border-white"/>
							</View>
							<View className="flex mt-4 w-full px-1">
								<Text numberOfLines={1} className="text-lg text-purple-400 font-semibold" >
									{item?.spaceName}
								</Text>
								<View className="flex mt-2 flex-row items-center" >
									<Icon2 name="key-variant"
									size={15} color="#A4A4A4"/>
									<Text className="text-md text-gray-400 ml-2 font-semibold" >
										{item?.code}
									</Text>
								</View>
								<View className="flex mt-2 flex-row items-center" >
									<Icon3 name="user"
									size={15} color="#A4A4A4"/>
									<Text className="text-md text-gray-400 ml-2 font-semibold" >
										{item?.owner}
									</Text>
								</View>
								<Pressable style={({ pressed }) => [{ opacity: pressed ? 0.5 : 1.0 }]} 
								 >
									<LinearGradient colors={['#9C3FE4','#C65647']}
									useAngle={true} angle={90} 
							        className="w-[100%] px-3 py-1 rounded-md mt-4 mx-auto"
							        >	
							        	{
							        		loading ?
							        		<ActivityIndicator size={19} color="white" style={{
							        			opacity:0.7
							        		}} />
							        		:
								        	<Text style={{fontFamily:"Poppins-Medium"}} 
								        	className="text-md font-semibold mx-auto text-white" >Join</Text>
							        	}
							        </LinearGradient>
						        </Pressable>
							</View>

						</View>
					)}
					/>

				</View>

			</SafeAreaView>
		</LinearGradient>

	</View>
	)
}


const styles = StyleSheet.create({
  
  centeredView: {
    flex: 1,
    justifyContent: 'flex-start',
    alignItems: 'center',
    marginBottom: 30,
  },
  
});